const banks = [bankOne, bankTwo];


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      power: true,
      display: String.fromCharCode(160), currentPadBank: bankOne,
      currentPadBankId: 'Heater Kit',
      sliderVal: 0.3
    }
  }

  render(){
    return (
      <div>
        <Container id="drum-machine" className="container">
          <Header />
